import React from "react";
import PotLockTokenLogo from "./PotLockTokenLogo.svg";

const FrontEndHome = () => {
  return (
    <div className="home-container">
      <h1>Welcome to PotLockToken!</h1>
      <img
        src={PotLockTokenLogo}
        alt="PotLockToken Logo"
        className="home-logo"
      />
      <u1>
        PotLockToken is a revolutionary token with unique tokenomics designed
        for growth and community involvement. Here's how it works:
        
        <li>Users will buy tokens as they normally would, however only 1 holder will be able to sell during the defined sell period.</li>
        <li>The selected wallet will be able to sell for the duration of the sell period, and when it expires other holders can burn tokens to reset the lottery which will randomly choose a new wallet that is able to sell.</li>
        <li>The currently selected wallet, sell period, and other token contract information will be posted to this site!</li>

      </u1>
      <h2>Tokenomics</h2>
      <ul>
        <li>Total Supply: 1,000,000 tokens</li>
        <li>Max Holding Per Wallet: 100 tokens</li>
        <li>Burn Mechanism: Every burn changes the selling wallet</li>
        <li>Taxes: 1% Devs, 2% Liquidity</li>
      </ul>
      <h3>Disclaimer</h3>
      <p>
        Investing in cryptocurrencies involves significant risks, and you may
        lose all your money. Please do your own research and invest
        responsibly.
      </p>
    </div>
  );
};

export default FrontEndHome;
